"use strict";

// BURGER
window.addEventListener('DOMContentLoaded', function () {
  var nav = document.querySelector('.nav__header'),
      navLink = document.querySelectorAll('.nav__link-header'),
      burger = document.querySelector('.burger');
  burger.addEventListener('click', function () {
    burger.classList.toggle('burger-active');
    nav.classList.toggle('nav__header-active');
  });
  navLink.forEach(function (item) {
    item.addEventListener('click', function () {
      burger.classList.toggle('burger-active');
      nav.classList.toggle('nav__header-active');
    });
  });
}); // POPUP

var btns = document.querySelectorAll('.btn__portfolio');
var modalOverlay = document.querySelector('.popup__body');
var modals = document.querySelectorAll('.popup__content');
btns.forEach(function (el) {
  el.addEventListener('click', function (e) {
    var path = e.currentTarget.getAttribute('data-path');
    modals.forEach(function (el) {
      el.classList.remove('popup__content--visible');
    });
    document.querySelector("[data-target=\"".concat(path, "\"]")).classList.add('popup__content--visible');
    modalOverlay.classList.add('popup__body--visible');
  });
});
modalOverlay.addEventListener('click', function (e) {
  console.log(e.target);

  if (e.target == modalOverlay) {
    modalOverlay.classList.remove('popup__body--visible');
    modals.forEach(function (el) {
      el.classList.remove('popup__content--visible');
    });
  }
});
